import React, { Component } from 'react'
import './intro.css'

class Intro extends Component{
    render(){
        return(
            <div className="container2">
                <p>Hi there, I'm</p>
                <b>Lucia Wei</b>
            </div>
            
        )
    }
}

export default Intro
